    "def ReLU(x):\n",
    "    return np.maximum(0.0, x)\n",
    "# derivacion funcion relu\n",
    "def ReLU_derivation(x):\n",
    "    if x <= 0:\n",
    "        return 0\n",
    "    else:\n",
    "        return 1\n",
    "X = np.linspace(-5, 5, 100)\n",
    "plt.plot(X, ReLU(X),'b')\n",
    "plt.xlabel('Eje X')\n",
    "plt.ylabel('Eje Y')\n",
    "plt.title('Funcion Lineal y Mixta')\n",
    "plt.grid()\n",
    "plt.grid()\n",
    "plt.show()"
